import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="h-screen max-w-[1440px] bg-black">
      <div className="w-[80%] h-[80%] flex flex-col space-y-3">
        <Link to="/users">Users</Link>
        <Link to="/posts">Posts</Link>
      </div>
    </div>
  );
};

export default Home;
